import React, { Component } from "react";
function handleClick(){
      console.log("I was Clicked");
}
function MyApp(){
      return(
            <div>
                  <img src="https://www.google.com/imgres?imgurl=https%3A%2F%2Fupload.wikimedia.org%2Fwikipedia%2Fcommons%2Fthumb%2Fb%2Fb6%2FImage_created_with_a_mobile_phone.png%2F1200px-Image_created_with_a_mobile_phone.png&imgrefurl=https%3A%2F%2Fen.wikipedia.org%2Fwiki%2FImage&tbnid=gxFxsvFBmxeZ9M&vet=12ahUKEwi45oiZ4ZTvAhUUkksFHZ-DA5QQMygAegUIARDQAQ..i&docid=0JWe7yDOKrVFAM&w=1200&h=900&q=image&ved=2ahUKEwi45oiZ4ZTvAhUUkksFHZ-DA5QQMygAegUIARDQAQ"/>
                  <br/><br/>
                  <button onClick={handleClick}>Click me</button>
            </div>
      )
}
export default MyApp;
